function checkout(){
    var data = {
        type:  $.trim($('.price-header span:first-child').eq(0).text()),
        summa: $.trim($('.price-header #headerTotal').eq(0).text()),
        summaD: $.trim($('.price-header span').eq(3).text()),
        elements: [],
        formData: {
            name: $.trim($('.checkoutInput').eq(0).val()),
            email:$.trim($('.checkoutInput').eq(1).val()),
            phone:$.trim($('.checkoutInput').eq(2).val())
        }
    };

    $.each($('.price-animation-frame table'),function(k,v){
        data.elements.push({
            title: $.trim($(v).find('h4').text()),
            paint: $.trim($(v).find('.price-item-summa-paint').eq(0).text()),
            repair: $.trim($(v).find('.price-item-summa-repair').eq(0).text()),
            replacement: $.trim($(v).find('.price-item-summa-replacement').eq(0).text()),
        });
    });
    console.log(data);
    if(data.formData.name == '' || data.formData.email == '' || data.formData.phone == '')
        alert('Заполните все поля!');
    else{
        $.post('sender.php',data,function(){},"json")
            .done(function(r){
                if(r.ok){
                    alert('Заказ успешно оформлен! C вами свяжется наш менеджер.');
                }
                else{
                    alert('Ошибка оформления заказа.');
                }

        }).fail(function(){
            alert('Ошибка подключения');
        })
    }
}